import React from "react";
import Module from "./Module";
import { Link } from 'react-router-dom'

function Register(props) {

  return (
    <Module
      headerButton="Войти"
      name="Регистрация"
      submitButton="Зарегистрироваться"
      link={'/sign-in'}
    >
      <button className="subSubmitButton"></button>
    </Module>
  )
}

export default Register;
